import React from 'react';
import './Header.css';
import { Container, Row, Col } from 'react-bootstrap';
import logo from '../img/logo.png';

const Header = () => {
  return (
    <header>
      <Container fluid='true'>
        <Row>
          <Col sm={12} lg={6} xl={{ span: 4, offset: 2 }}>
            <a href="index.html" class="logo"><img src="img/logo.png" alt="Gooder - social network for good actions" /></a>
            <nav class="main-nav">
              <ul>
                <li><a href="#">Home</a></li>
                <li><a href="#">About</a></li>
                {/* <li class="current"><a href="about.html">אודות</a></li> */}
              </ul>
            </nav>
          </Col>
        </Row>
      </Container>
    </header>
  );
};

export default Header;
